    public void setName(String name) {
        this.name = name;
    }

    public List&lt;SubCategory&gt; getSubCategories() {
        return subCategories;
    }

    public void setSubCategories(List&lt;SubCategory&gt; subCategories) {
        subCategories = subCategories;
